B.KS=new A.bt([1,"Arvores ca\xeddas atrapalhando o caminho.",2,"Uma lama f\xe9tida e grudenta.",3,"O rio tem consist\xeancia de mel.",4,"Cip\xf3s e arbustos emaranhados pelo caminho.",5,"Um gigantesco ninho de vespas.",6,"Um bando de javalis em debandada.",7,"Uma montanha de musgo que fala.",8,"Esculturas de pessoas em folhas.",9,"Teias de aranha bloqueiam o caminho.",10,"As arvores ficam t\xe3o densas que bloqueiam a luz do sol e da lua.",11,"Uma n\xe9voa de p\xf3len afeta seus sentidos dando aquela rinite braba, coceira no olho e nariz.",12,"Uma prociss\xe3o de caramujos desliza lentamente pela floresta.",13,"Lesmas de gosma \xe1cida bloqueiam uma ponte.",14,"Um cheiro esfuma\xe7ado come\xe7a adentrar seus narizes, em pouco tempo as cores das \xe1rvores est\xe3o mudando de cor, os galhos se movem, \xe9 como uma viagem psicod\xe9lica.",15,"Voc\xea tem certeza que as \xe1rvores est\xe3o chamando seu nome e te convencendo a seguir em uma determinada dire\xe7\xe3o.",16,"Voc\xeas come\xe7am a ouvir cochichos, aqui e ali, logo notam pequeninos seres, do tamanho de uma m\xe3o se enfiando em troncos, arbustos, pequenos buracos.",17,'Um \xfanico corvo d\xe1 as caras e come\xe7a a gritar xingamentos e maldi\xe7\xf5es. Diz que vai chamar "O GATO".\nO GATO \xe9 um dem\xf4nio antigo e adormecido dessa floresta.\nO GATO aparece com uma aura sombria e exige tributos, do contr\xe1rio vai acordar as arvores malditas e monstros indom\xe1veis.',18,"Uma n\xe9voa que faz com que 2 pessoas que entrem nela troquem de habilidades (mecanicamente, 2 PCs que estiverem na n\xe9voa ao mesmo tempo trocam de classe enquanto estiverem na n\xe9voa)."],t.TM)
